import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/design-system.css';
import './Landing.css';

function Landing() {
  const navigate = useNavigate();
  const [showTermsModal, setShowTermsModal] = useState(false);
  const [showPrivacyModal, setShowPrivacyModal] = useState(false);

  // Add body class for landing page and remove on cleanup
  useEffect(() => {
    document.body.classList.add('landing-page');
    
    // Cleanup function to remove class when component unmounts
    return () => {
      document.body.classList.remove('landing-page');
    };
  }, []);

  // Close modals on escape key
  useEffect(() => {
    const handleEscape = (e) => {
      if (e.key === 'Escape') {
        setShowTermsModal(false);
        setShowPrivacyModal(false);
      }
    };

    document.addEventListener('keydown', handleEscape);
    return () => document.removeEventListener('keydown', handleEscape);
  }, []);

  const handleUserLogin = () => {
    navigate('/user/login');
  };

  const handleUserRegister = () => {
    navigate('/user/register');
  };

  const handleAdminLogin = () => {
    navigate('/admin/login');
  };

  return (
    <div className="landing-container">
      {/* Header Section */}
      <header className="landing-header">
        <div className="container">
          <div className="header-content">
            <img src="/barangay_logo.png" alt="Barangay Logo" className="logo" />
            <div className="header-text">
              <h1 className="title">Barangay Mangan-vaca</h1>
              <h2 className="subtitle">Job Portal</h2>
              <p className="description">Connecting opportunities within our community</p>
            </div>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="landing-main">
        <div className="container">
          <div className="access-grid">
            {/* User Access Card */}
            <div className="access-card user-card">
              <div className="card-icon">
                <svg width="48" height="48" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M16 7C16 9.20914 14.2091 11 12 11C9.79086 11 8 9.20914 8 7C8 4.79086 9.79086 3 12 3C14.2091 3 16 4.79086 16 7Z" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                  <path d="M12 14C8.13401 14 5 17.134 5 21H19C19 17.134 15.866 14 12 14Z" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                </svg>
              </div>
              <h3 className="card-title">Job Seekers & Employers</h3>
              <p className="card-description">
                Find your next opportunity or discover talented individuals in our community
              </p>
              <div className="card-features">
                <div className="feature">
                  <span className="feature-icon">🔍</span>
                  <span>Browse Jobs</span>
                </div>
                <div className="feature">
                  <span className="feature-icon">📝</span>
                  <span>Apply Online</span>
                </div>
                <div className="feature">
                  <span className="feature-icon">💼</span>
                  <span>Post Jobs</span>
                </div>
              </div>
              <div className="card-actions">
                <button 
                  className="btn btn-primary btn-lg"
                  onClick={handleUserLogin}
                >
                  Sign In
                </button>
                <button 
                  className="btn btn-secondary btn-lg"
                  onClick={handleUserRegister}
                >
                  Create Account
                </button>
              </div>
            </div>

            {/* Admin Access Card */}
            <div className="access-card admin-card">
              <div className="card-icon admin-icon">
                <svg width="48" height="48" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M12 1L3 5L12 9L21 5L12 1Z" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                  <path d="M3 17L12 21L21 17" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                  <path d="M3 12L12 16L21 12" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                </svg>
              </div>
              <h3 className="card-title">System Administration</h3>
              <p className="card-description">
                Manage the job portal, oversee operations, and maintain community standards
              </p>
              <div className="card-features">
                <div className="feature">
                  <span className="feature-icon">👥</span>
                  <span>User Management</span>
                </div>
                <div className="feature">
                  <span className="feature-icon">📊</span>
                  <span>Analytics</span>
                </div>
                <div className="feature">
                  <span className="feature-icon">⚙️</span>
                  <span>System Control</span>
                </div>
              </div>
              <div className="card-actions">
                <button 
                  className="btn btn-primary btn-lg admin-btn"
                  onClick={handleAdminLogin}
                >
                  Admin Login
                </button>
              </div>
            </div>
          </div>
        </div>
      </main>

      {/* Footer */}
      <footer className="landing-footer">
        <div className="container">
          <p className="footer-text">
            © 2025 Barangay Mangan-vaca. Building stronger communities through employment.
          </p>
        </div>
      </footer>
    </div>
  );
}

export default Landing;
